import math
def distance(x1,x2,y1,y2):
  a=(x2-x1)**2
  b=(y2-y1)**2
  c=math.sqrt(a+b)
  print('distance=',c)
  return c 


def area(radius):
  return math.pi*radius**2

def circle_arae(xc,yc,xp,yp):
  radius=distance(xc,yc,xp,yp)
  result=area(radius)
  print('result=',result)
  return result

circle_arae(1,2,3,4)

