def invert_dict(d):
  inverse=dict ()
  for key in d:
    val=d[key]
    if val not in inverse:
      inverse[val]=[key]
    else:
      inverse[val].append(key)
  return inverse
a=dict()
a={'hs':1,"keys":8,"key":5}
invert_dict(a)

