#os.path.exists()用于检查一个文件或目录是否存在
#os.path.isdir()若存在，可检查是否是一个目录
#os.path.isfile()检查是否是一个文件
#os.listdir()返回给定目录下的文件列表（以及其他目录）
#os.path.join(a,b)接受连个参数，并将它们合并。

def walk(dirname):
  for name in os.listdir(dirname):
    path=os.path.join(dirname,name)

    if os.path.isfile(path):
      print(path)
    else:
      walk=(path)

walk(cwd)

